#include<iostream>
#include<queue>
#include<bitset>
#include<algorithm>
 // сортировка очередями ,со сложностью n+w 

template<typename T>
void Radix_sort(std::vector<T>& v, const int& left, const int& right) {

	std::queue<T> q_0, q_1;
	const int cluster = sizeof(T) * 8;

	for (size_t k = 0; k < cluster; ++k)
	{
		for (size_t i = left; i <= right; ++i)
		{
			std::bitset<cluster> b = v[i];
			if (b[k] == 0)
			{
				q_0.push(v[i]);
			}
			else
			{
				q_1.push(v[i]);
			}
		}
		size_t pos = left;
		while (!q_0.empty())
		{
			v[pos++] = q_0.front();
			q_0.pop();
		}
		while (!q_1.empty())
		{
			v[pos++] = q_1.front();
			q_1.pop();
		}
	}
	
	int pos = right+1;
	for (size_t i = left; i < right+1; i++)
	{
		if (v[i]<0)
		{
			pos = i;
			break;
		}
	}

	if (pos != right + 1)
	{
		std::reverse(v.begin()+left, v.begin() + pos);
		std::reverse(v.begin()+ pos, v.begin()+right+1);
		std::reverse(v.begin()+left, v.begin() + right+1);
	}
}

